let update = window.document.querySelector("#btn-submit-facets");
let soundString1 = "";
let soundString2 = "";
let soundString3 = "";
var snd1 = new Audio("data:audio/wav;base64," + soundString1);
var snd2 = new Audio("data:audio/wav;base64," + soundString2);
var snd3 = new Audio("data:audio/wav;base64," + soundString3);
const array_subjects = ["math", "science", "alt. ed", "geography"];
const array_schools = ["glendale", "sir winston churchill"];

setInterval(()=>{
 let anchorText = window.document.querySelectorAll("h4>a");
 let cont= window.document.querySelectorAll("button");
 
 for(let j=0; j < cont.length; j++){if(cont[j].innerText.toLowerCase()=="continue"){cont[j].click()}};
 
 for(let i=0; i < anchorText.length; i++){
      setTimeout(()=>{},200);

      let subject = anchorText[i].innerText.toLowerCase().trim();
      let school = anchorText[i].parentElement.parentElement;
      console.log(school);
  
      if(subject == "library"){
          snd1.play()
      }else if(array_subjects.includes(subject) && array_schools.includes(school) ){
          snd3.play()
      };
 };
 
 update.click(); 
     

 },10000);
